import React from "react";
import "../css/mainBlock.css";
import logo from "../img/logo.png";
import MySlider from "./MySlider";

function Header() {
  return (
    <header>
      <div className="container">
        <a href="#">
          <img src={logo} alt="logo" />
        </a>
        <menu>
          <li>
            <a href="#">Главная</a>
          </li>
          <li>
            <a href="#">О нас</a>
          </li>
          <li>
            <a href="#">Услуги</a>
          </li>
          <li>
            <a href="#">Врачи</a>
          </li>
          <li>
            <a href="#">Отзывы</a>
          </li>
          <li>
            <a href="#">Контакты</a>
          </li>
        </menu>
        <button>Записаться</button>
      </div>
    </header>
  );
}
function Slider() {
  return <div className="slider"></div>;
}
function MainBlock() {
  return (
    <div>
      <section className="main-block">
        <Header />
      </section>
      <MySlider />
    </div>
  );
}
export default MainBlock;
